    const aboutMeButtonClass = `dropdown--content-button ${props.id.aboutMe && clickedButton}`
    const cvButtonClass = `dropdown--content-button ${props.id.cv && clickedButton}`
    const skillsButtonClass = `dropdown--content-button ${props.id.skills && clickedButton}`

    return (
        <div className="dropdown">
            <button className="dropdown-button"><i className="dropdown--color fa-solid fa-navicon"></i></button>
            <div className="dropdown-content">
                <button className={startButtonClass} onClick={
                    () => props.toggleEnabled("start")
